import React, {useState} from 'react';

const ViewObject = ({ valObject, expanded=false }) => {
    const keys = Object.keys(valObject);
    const [childExpanded, setChildExpanded] = useState(false);

    const parseObject = ({key, value, expanded, setExpanded}) => {
        if (typeof value === 'string' || typeof value === 'number' || typeof value === 'boolean') {
            return (
                <div>
                    <span>{key}: </span>
                    <span>{value}</span>
                </div>
              )
        } else if (typeof value === 'object') {
            const handleClick = () => {
                setChildExpanded(!childExpanded);
            };
            return (
                <button onClick={handleClick} style={{marginLeft: '5px'}}>
                    <span>{key}:</span>
                    { expanded ?
                        <ViewObject valObject={value} />
                        :
                        <span>...</span>
                    }
                </button>
            )
        } else {
            return null;
        }
    };
    return (
        <div>
            { keys.map(key => {
              return parseObject({key, value: valObject[key]});
            })}
        </div>
    );
}

export default ViewObject;
